import React from 'react';
import 'bootstrap/dist/css/bootstrap.min.css';
import Main from './main';
import Header from './header';
import Footer from './footer'; 

function App() {
  return (
    <div className="App">

    <>
    <Header />
    <Main />
    <Footer />

    </>


    </div>
  );
}

export default App;
